<template>
  <div>
    <button
      type="primary"
      @click="initPrinter"
    >
      初始化打印
    </button>
    <button
      type="primary"
      @click="closePrinter"
    >
      关闭打印
    </button>
    <button
      type="primary"
      @click="printerText"
    >
      打印小票
    </button>
    <button
      type="primary"
      @click="printerLabel"
    >
      测试打印
    </button>
    <button
      type="primary"
      @click="printLabel"
    >
      打印标签
    </button>
    <button
      type="primary"
      @click="printQR"
    >
      打印二维码
    </button>
    <button
      type="primary"
      @click="printBitmap"
    >
      图片
    </button>
    <button
      type="primary"
      @click="printFont"
    >
      打印字体模板
    </button>
    <button
      type="primary"
      @click="getSupport"
    >
      获取版本
    </button>
    <button
      type="primary"
      @click="printTest"
    >
      回纸距离
    </button>
  </div>
</template>

<script>
const printer = uni.requireNativePlugin('LcPrinter')
const modal = uni.requireNativePlugin('modal')
var globalEvent = uni.requireNativePlugin('globalEvent')

// 在全局定义一个变量来标识是否已经初始化
var isPrinterInitialized = false

export default {
  data() {
    return {}
  },
  onLoad: function () {
    // 添加打印状态监听
    if (!isPrinterInitialized) {
      globalEvent.addEventListener('onPrintCallback', function (e) {
        uni.showToast({
          title: 'state: ' + JSON.stringify(e),
          duration: 2000
        })
        if (e.key == 0) {
          uni.showToast({
            title: '打印成功',
            duration: 2000
          })
        } else if (e.key == 3) {
          uni.showToast({
            title: '缺纸',
            duration: 2000
          })
        }
      })
      globalEvent.addEventListener('getsupportprint', function (e) {
        console.log('key: ' + JSON.stringify(e))
        uni.showToast({
          title: 'key: ' + JSON.stringify(e),
          duration: 2000
        })
      })
    }
    //再初始化
    this.initPrinter()
  },
  created: function (option) {},
  onHide: function () {},
  destroyed: function () {},
  methods: {
    initPrinter() {
      // 调用异步方法
      console.log('新版初始化')
      var ret = printer.initPrinter({})
      modal.toast({
        message: ret,
        duration: 1.5
      })
      printer.printEnableMark({
        enable: false
      })
      printer.setConcentration({
        //设置打印浓度。font_level 取值范围：1~39。
        level: 39
      })
      printer.setLineSpacing({
        spacing: 1
      })
      //add by ljh
      printer.setFontSize({
        fontSize: 8
      })
      //add end
      printer.getsupportprint()
    },
    getSupport() {
      console.log('获取版本号')
      printer.getsupportprint()
    },
    closePrinter() {
      // 调用同步方法
      console.log('关闭')
      printer.closePrinter()
    },
    printerLabel() {
      console.log('测试打印')

      printer.setFontSize({
        //设置字体大小
        fontSize: 0
      })
      printer.setTextBold({
        //设置字体是否加粗
        bold: true
      })

      printer.printText({
        content: '垃圾收运小票凭证'
      })
      printer.printLine({
        //走纸 1 行
        line_length: 1
      })
      printer.printText({
        content: '€€€€€€€€€€€€'
      })
      printer.printLine({
        //走纸 1 行
        line_length: 1
      })

      console.log('测试打印QR')
      printer.printQR2({
        text: 'title',
        height: 100,
        offset: 1
      })
      printer.printLine({
        //走纸 1 行
        line_length: 2
      })

      printer.start()
      console.log('测试打印QR结束')
    },
    printBitmap() {
      console.log('测试图片')
      printer.printEnableMark({
        enable: true
      })
      printer.setConcentration({
        //设置打印浓度。font_level 取值范围：1~39。
        level: 39
      })
      // printer.printBitmap2({
      // 	// offset: 1,
      // 	base64: ''
      //
      // });
      /* printer.printBitmap2({
					// offset: 1,
					base64: ''
				}); */
      printer.printBitmap2({
        // offset: 1,
        base64:
          ''
      })
      printer.printLine({
        //走纸 1 行
        line_length: 1
      })

      printer.printGoToNextMark()

      // printer.start();
    },
    printQR() {
      console.log('测试打印二维码')
      printer.printQR2({
        text: 'aaa',
        offset: 1,
        height: 200
      })
      printer.start()
    },
    printerText() {
      console.log('打印小票')
      printer.printText2({
        offset: 1,
        fontSize: 8,
        isBold: true,
        isUnderLine: true,
        content: '左\r\n'
      })

      printer.printText2({
        offset: 1,
        fontSize: 3,
        isBold: false,
        isUnderLine: false,
        content: '左DDDDDDDDDDDDDDD\r\n'
      })

      printer.printText({
        offset: 1,
        fontSize: 3,
        isBold: false,
        isUnderLine: false,
        content: '右GGGGGGGGGGGGG\r\n'
      })

      printer.printText2({
        offset: 2,
        fontSize: 3,
        isBold: false,
        isUnderLine: false,
        content: '中'
      })
      // printer.printText({
      // 	content: '          '
      // });

      printer.printText2({
        offset: 3,
        fontSize: 3,
        isBold: false,
        isUnderLine: false,
        content: '右'
      })

      printer.printText({
        content: '   '
      })
      printer.printLine({
        line_length: 1
      })
      printer.printText({
        content: 'unit price'
      })
      printer.printLine({
        line_length: 1
      })

      printer.printBarcode({
        text: '123456',
        height: 80,
        barcodeType: 73
      })
      printer.printBarcode({
        text: '123456',
        height: 80,
        barcodeType: 73
      })
      printer.printBarcode2({
        offset: 2,
        height: 40,
        text: '123132',
        barcodeType: 73,
        hriPosition: 1
      })
      printer.printLine({
        line_length: 1
      })
      printer.printQR({
        text: '1234456'
      })
      printer.printText({
        content: 'unit price'
      })
      printer.printLine({
        line_length: 1
      })
      printer.printLine({
        line_length: 2
      })
      printer.start() //热敏打印使用,开始走纸
    },
    printLabel() {
      console.log('打印标签')
      printer.printBarcode({
        text: 1234567890123456789,
        height: 80,
        barcodeType: 73
      })
      printer.printLine({
        line_length: 5
      })
      printer.printGoToNextMark() //标签打印使用,开始走纸
    },

    //add by ljh
    printTest() {
      printer.printEnableMark({ enable: false })
      console.log('测试回纸距离')
      printer.printBarcode({
        text: 1234567890123456789,
        height: 80,
        barcodeType: 73
      })
      //printer.setFeedPaperSpace({ space: 1000});
      printer.setUnwindPaperLen({ length: 60 })
      printer.printLine({
        line_length: 5
      })

      //printer.printGoToNextMark();//标签打印使用,开始走纸
      printer.start() //热敏打印使用,开始走纸
    },
    //add end

    scan() {
      console.log('打开扫码')
      // 允许从相机和相册扫码
      uni.scanCode({
        success: function (res) {
          console.log('条码类型：' + res.scanType)
          console.log('条码内容：' + res.result)
        }
      })
    },
    printFont() {
      console.log('测试打印字体模板')
      printer.printText2({
        offset: 1,
        fontSize: 1,
        isBold: true,
        isUnderLine: false,
        content: '左\r\n'
      })
      printer.printText2({
        offset: 1,
        fontSize: 1,
        isBold: true,
        isUnderLine: false,
        content: '左\r\n'
      })
      printer.printText2({
        offset: 1,
        fontSize: 1,
        isBold: true,
        isUnderLine: false,
        content: '左\r\n'
      })
      printer.printText2({
        offset: 1,
        fontSize: 4,
        isBold: true,
        isUnderLine: true,
        content: '左\r\n'
      })
      printer.printText2({
        offset: 1,
        fontSize: 5,
        isBold: true,
        isUnderLine: true,
        content: '左\r\n'
      })
      printer.printText2({
        offset: 1,
        fontSize: 6,
        isBold: true,
        isUnderLine: true,
        content: '左\r\n'
      })
      printer.printText2({
        offset: 1,
        fontSize: 7,
        isBold: true,
        isUnderLine: true,
        content: '左\r\n'
      })
      printer.printText2({
        offset: 1,
        fontSize: 8,
        isBold: true,
        isUnderLine: true,
        content: '左\r\n'
      })
      printer.printLine({
        line_length: 2
      })
      printer.start() //热敏打印使用(开始走纸)
    }
  }
}
</script>

<style></style>
